
/**
 * 省市区三级联动，
 * @param  json datas 省市区数据json，以id为索引
 * @param  string pkey  代表父集的key名
 * @param  string vkey  代表数据value值的key名
 * @param  string tkey  代表数据text的key名
 * @param  array names  三级联动的各个select名称（id则为 id_{name}）
 * @param  array vals   三级联动的各个select初始值
 * @param  string wrapid 页面上容器的id
 * @return html      返回三级联动html
 */
function selectTrees(datas,vkey,tkey,pkey,names,vals,wrapid){
	var dom_fragdoc,dom_first,dom_second,dom_third,dom_area,dom_op_default;
	// 初始值
	vals = vals||[0,0,0];

	// 创建dom
	dom_fragdoc = document.createDocumentFragment();
	dom_first = $('<select data-idx="1" name="'+names[0]+'" id="id_'+names[0]+'"><option value="0">请选择</option></select>');
	dom_second = $('<select data-idx="2" name="'+names[1]+'" id="id_'+names[1]+'"><option value="0">请选择</option></select>');
	dom_third = $('<select data-idx="3" name="'+names[2]+'" id="id_'+names[2]+'"><option value="0">请选择</option></select>');
	dom_area = $('<input type="hidden" name="'+wrapid+'_areas" value="'+getAreas(vals)+'"/>');
	
	dom_first.on('change',listener);
	dom_second.on('change',listener);
	dom_third.on('change',listener);
	// 绘制到网页上
	$('#'+wrapid).append(dom_first);
	$('#'+wrapid).append(dom_second);
	$('#'+wrapid).append(dom_third);
	$('#'+wrapid).append(dom_area);

	// 第一个select
	getChildsByPid(dom_first,0,vals[0]);

	if (vals[0]>0) {
		getChildsByPid(dom_second,vals[0],vals[1]);
		getChildsByPid(dom_third,vals[1],vals[2]);
	}

	// 为某个select注入数据
	function getChildsByPid(wrap,pid,val){
		wrap[0].length = 1;
		for(var k in datas){
			var _v = datas[k];
			if (_v[pkey] == pid) {
				var str = "";
				if (val && (_v[vkey] == val)) {
					str= 'selected = "selected"';
				}
				wrap.append('<option value="'+_v[vkey]+'" '+str+'>'+_v[tkey]+'</option>');
			}
		}
	}
	// 获取地址组合的字符串
	function getAreas(){
		var p = vals[0]>0?datas[vals[0]][tkey]:'',
			c = vals[1]>0?datas[vals[1]][tkey]:'',
			a = vals[2]>0?datas[vals[2]][tkey]:'';
		return p+c+a;
	}
	// select绑定事件
	function listener(e){
		var o = $(this),
			childsel = o.next('select').eq(0),
			id = parseInt(this.value),
			idx = o.data('idx');
		if (childsel.length>0) {
			getChildsByPid(childsel,id);
		}
		// 联动初始化
		if (idx == 1) {
			dom_third[0].length = 1;
			vals[0]=id; vals[1]=0; vals[2]=0;
		}else if(idx == 3){
			vals[2]=id;
		}else{
			vals[1]=id;vals[2]=0;
		}
		dom_area.val(getAreas());
	}
}

